import React from 'react';
import logo from './logo.svg';
import './App.css';
import Home from './pages/Home';
import {Sugar} from 'react-preloaders';


function App() {
  return (
    <div>
      <Sugar background="#1976d2" color="#bbdefb" time={5000} />
      <Home />
    </div>
  );
}

export default App;
